import React from "react";
import "./FaceRecogniton.css";

const FaceRecogniton = ({ imageURL, box }) => {
  return (
    <div className="center">
      <img id="inputimage" src={imageURL} alt="" />
      <div className="bounding-box" />
    </div>
  );
};

export default FaceRecogniton;
